style.css:
@-moz-document url-prefix("https://rubygems.org/"), url-prefix("https://www.rubygems.org/")
{
.header{
background-color: #696969 !important;  
}

.header__search, .gem__code, .gem__code-wrap{
  background-color: #696969 !important;  
}

#session_password, #session_who, #user_email, #user_handle, #user_password{
  background-color: #696969 !important; 
  color: #e9573f;
}

.main--interior{
background-color: black;
}

h1, h2{
   color: white;
}

i, label, em.current, h2.stat, .footer__about a:hover,.stats__graph__heading, .stats__graph__gem__name a{
  color: #e9573f !important;
}

.footer__about a{
  color: #ffa500 !important;
}

.gems__meter, .t-link--gray, .t-link--gray:hover{
    color: #e9573f;
}

input.header__search, .header__logo, p, li, .header__nav-link{
color: #e9573f;
}

p.gems__gem__downloads__count{
  color: #e9573f;
}

a.footer__sponsor, a.nav--v__link--footer, .gem__code__tooltip--copy, .gem__code__tooltip--copied {
  color: #e9573f;
}

.gems__gem__name, .gem__code__icon, .gem__code__icon::before, .gem__code__icon::after{
  color: #e9573f;
}

a.t-link--black, a.page__heading{
  color:#e9573f !important;
}
.news__nav-link{
  color:#e9573f;
  background-color: white;
}

.aggregations{
  background-color: black;
  color: #e9573f;
}

.gem__ruby-version, a.t-list__item, .gem__sha, .gem__downloads__heading{
  color: #e9573f;
}
.nav--v__link, .gems__nav-link, .pagination{
  color: white;
}
}
